}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`RedisAI is a Redis module for executing deep learning/machine learning models and managing their data. It provides tensors as a data type and deep-learning model execution on CPUs and GPUs. RedisAI turns Redis Enterprise into a full-fledged deep- learning runtime.The RedisAI module is seamlessly plugged into Redis. It is a scalable platform that addresses the unique requirements for both AI training and AI inference in one server. It provides a complete software platform that allows data scientists to easily deploy and manage AI solutions for enterprise applications. `}</p>
    <p>{`The platform combines popular open source deep learning frameworks (PyTorch, ONNXRuntime, and TensorFlow), software libraries, and Redis modules like RedisGears, RedisTimeSeries, and more. With RedisAI, AI application developers no longer have to worry about tuning databases for performance. Requiring no added infrastructure, RedisAI lets you run your inference engine where the data lives, decreasing latency. `}</p>
    <p>{`Below is an interesting example of Iris(a genus of species of flowering plants with showy flowers) classification based on measurement of width and length of sepal/petals that makes up input tensors and how to load these measurements into RedisAI:`}</p>
    <h3 {...{
      "id": "step-1-installing-redisai"
    }}>{`Step 1. Installing RedisAI`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` docker run \\
   -p 6379:6379 \\
   redislabs/redismod \\
   --loadmodule /usr/lib/redis/modules/redisai.so \\
     ONNX redisai_onnxruntime/redisai_onnxruntime.so
`}</code></pre>
    <p>{`You will see that ONNX backend getting loaded as shown below in the results.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` 1:C 09 Jun 2021 12:28:47.985 # oO0OoO0OoO0Oo Redis is starting oO0OoO0OoO0Oo
 1:C 09 Jun 2021 12:28:47.985 # Redis version=6.0.1, bits=64, commit=00000000, modified=0, pid=1, just started
 1:C 09 Jun 2021 12:28:47.985 # Configuration loaded
 1:M 09 Jun 2021 12:28:47.987 * Running mode=standalone, port=6379.
 1:M 09 Jun 2021 12:28:47.987 # Server initialized
 1:M 09 Jun 2021 12:28:47.987 # WARNING you have Transparent Huge Pages (THP) support enabled in your kernel. This will create latency and memory usage issues with Redis. To fix this issue run the command 'echo never > /sys/kernel/mm/transparent_hugepage/enabled' as root, and add it to your /etc/rc.local in order to retain the setting after a reboot. Redis must be restarted after THP is disabled.
 1:M 09 Jun 2021 12:28:47.989 * <ai> Redis version found by RedisAI: 6.0.1 - oss
 1:M 09 Jun 2021 12:28:47.989 * <ai> RedisAI version 10003, git_sha=7f808a934dff121e188cb76fdfcc3eb1f9ec7cbf
 1:M 09 Jun 2021 12:28:48.011 * <ai> ONNX backend loaded from /usr/lib/redis/modules/backends/redisai_onnxruntime/redisai_onnxruntime.so
 1:M 09 Jun 2021 12:28:48.011 * Module 'ai' loaded from /usr/lib/redis/modules/redisai.so
 1:M 09 Jun 2021 12:28:48.011 * Ready to accept connections
`}</code></pre>
    <p>{`You can verify if RedisAI module is loaded or not by running the below CLI`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` 127.0.0.1:6379> info modules
 # Modules
 module:name=ai,ver=10003,api=1,filters=0,usedby=[],using=[],options=[]

 # ai_git
 ai_git_sha:7f808a934dff121e188cb76fdfcc3eb1f9ec7cbf

 # ai_load_time_configs
 ai_threads_per_queue:1
 ai_inter_op_parallelism:0
 ai_intra_op_parallelism:0
`}</code></pre>
    <h3 {...{
      "id": "step-2-setup-python-environment"
    }}>{`Step 2. Setup Python Environment`}</h3>
    <p>{`Ensure that Python3.8+ is installed.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` brew install python
`}</code></pre>
    <h3 {...{
      "id": "step-3-install-pip"
    }}>{`Step 3. Install PIP`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` pip install --upgrade pip
`}</code></pre>
    <h3 {...{
      "id": "step-4-clone-the-repository"
    }}>{`Step 4. Clone the repository`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` git clone https://github.com/redis-developer/redisai-iris
`}</code></pre>
    <h3 {...{
      "id": "step-5-install-the-dependencies"
    }}>{`Step 5. Install the dependencies`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` pip install -r requirements.txt
`}</code></pre>
    <h3 {...{
      "id": "step-6-step-3-build-the-onnx-model"
    }}>{`Step 6. Step 3: Build the ONNX Model`}</h3>
    <p>{`RedisAI supports DL/ML identifiers and their respective backend libraries, including:`}</p>
    <ul>
      <li parentName="ul">{`TF: The TensorFlow backend`}</li>
      <li parentName="ul">{`TFLITE: The TensorFlow Lite backend`}</li>
      <li parentName="ul">{`TORCH: The PyTorch backend`}</li>
      <li parentName="ul">{`ONNX: ONNXRuntime backend`}</li>
    </ul>
    <p>{`A complete list of supported backends is in the `}<a parentName="p" {...{
        "href": "https://docs.redislabs.com/latest/modules/redisai/release-notes/redisai-1.0-release-notes/"
      }}>{`release notes for each version`}</a>{`.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` python3 build.py
`}</code></pre>
    <h3 {...{
      "id": "step-7-deploy-the-model-into-redisai"
    }}>{`Step 7: Deploy the Model into RedisAI`}</h3>
    <p>{`Model is a Deep Learning or Machine Learning frozen graph that was generated by some framework. The RedisAI Model data structure represents a DL/ML model that is stored in the database and can be run.Models, like any other Redis and RedisAI data structures, are identified by keys. A Modelâ€™s key is created using the AI.MODELSET command and requires the graph payload serialized as protobuf for input.`}</p>
    <p>{`NOTE: This requires redis-cli. If you don't have redis-cli, I've found the easiest way to get it is to download, build, and install Redis itself. Details can be found at `}<a parentName="p" {...{
        "href": "https://redis.io/topics/quickstart"
      }}>{`the Redis quickstart page`}</a></p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli -x AI.MODELSET iris ONNX CPU BLOB < iris.onnx
`}</code></pre>
    <h3 {...{
      "id": "step-8-make-some-predictions"
    }}>{`Step 8. Make Some Predictions`}</h3>
    <p><a parentName="p" {...{
        "href": "https://oss.redislabs.com/redisai/commands/#aitensorset"
      }}>{`The AI.TENSORSET command`}</a>{` stores a tensor as the value of a key.`}</p>
    <p>{`Launch redis-cli:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli
`}</code></pre>
    <h3 {...{
      "id": "step-9-set-the-input-tensor"
    }}>{`Step 9. Set the input tensor`}</h3>
    <p>{`This will set the key 'iris' to the 2x4 RedisAI tensor( i.e. 2 sets of inputs of 4 values each)`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` AI.TENSORSET iris:in FLOAT 2 4 VALUES 5.0 3.4 1.6 0.4 6.0 2.2 5.0 1.5
`}</code></pre>
    <p>{`where, `}</p>
    <ul>
      <li parentName="ul">{`iris refers to the tensor's key name,`}</li>
      <li parentName="ul">{`FLOAT is a tensor's data type`}</li>
      <li parentName="ul">{`{5.0 3.4 1.6 0.4} refers to 1st item with 4 features`}</li>
      <li parentName="ul">{`{6.0 2.2 5.0 1.5} refers to 2nd item with 4 features`}</li>
    </ul>
    <h3 {...{
      "id": "step-10-display-tensorget-in-blob-format"
    }}>{`Step 10. Display TENSORGET in BLOB format`}</h3>
    <p>{`The AI.TENSORGET command returns a tensor stored as key's value.
The BLOB indicates that data is in binary format and is provided via the subsequent data argument`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli AI.TENSORGET iris:in BLOB
 "\\x00\\x00\\xa0@\\x9a\\x99Y@\\xcd\\xcc\\xcc?\\xcd\\xcc\\xcc>\\x00\\x00\\xc0@\\xcd\\xcc\\x0c@\\x00\\x00\\xa0@\\x00\\x00\\xc0?"
`}</code></pre>
    <h3 {...{
      "id": "step-11-check-the-predictions"
    }}>{`Step 11. Check the predictions`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli AI.TENSORGET iris:in VALUES
 1) "5"
 2) "3.4000000953674316"
 3) "1.6000000238418579"
 4) "0.40000000596046448"
 5) "6"
 6) "2.2000000476837158"
 7) "5"
 8) "1.5"
`}</code></pre>
    <h3 {...{
      "id": "step-12-display-tensorget-meta-information"
    }}>{`Step 12. Display TENSORGET META information`}</h3>
    <p>{`The META used with `}<inlineCode parentName="p">{`AI.TENSORGET`}</inlineCode>{` returns the tensor's metadata as shown below:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli AI.TENSORGET iris:in META
   1) "dtype"
   2) "FLOAT"
   3) "shape"
   4) 1) (integer) 2
      2) (integer) 4

`}</code></pre>
    <h3 {...{
      "id": "step-13-display-tensorget-meta-information-with-tensor-values"
    }}>{`Step 13. Display TENSORGET META information with tensor values`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`  redis-cli AI.TENSORGET iris:in META VALUES
 1) "dtype"
 2) "FLOAT"
 3) "shape"
 4) 1) (integer) 2
    2) (integer) 4
 5) "values"
 6) 1) "5"
    2) "3.4000000953674316"
    3) "1.6000000238418579"
    4) "0.40000000596046448"
    5) "6"
    6) "2.2000000476837158"
    7) "5"
    8) "1.5"
`}</code></pre>
    <h3 {...{
      "id": "step-14-run-the-model"
    }}>{`Step 14. Run the model`}</h3>
    <p>{`Define inputs for the loaded model.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli AI.MODELRUN iris INPUTS iris:in OUTPUTS iris:inferences iris:scores
 OK
`}</code></pre>
    <h3 {...{
      "id": "step-15-make-the-prediction"
    }}>{`Step 15. Make the prediction`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli AI.TENSORGET iris:inferences VALUES META
 1) "dtype"
 2) "INT64"
 3) "shape"
 4) 1) (integer) 2
 5) "values"
 6) 1) (integer) 0
 2) (integer) 2
`}</code></pre>
    <h3 {...{
      "id": "references"
    }}>{`References`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/redis-developer/redisai-iris"
        }}>{`Sample IRIS Classification Source Code`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://oss.redislabs.com/redisai/"
        }}>{`RedisAI - A Server for Machine and Deep Learning Models`}</a></li>
    </ul>
    <h3 {...{
      "id": "redis-university"
    }}>{`Redis University`}</h3>
    <h4 {...{
      "id": "redisai-explained"
    }}>{`RedisAI Explained`}</h4>
    <div class="text--center">
      <iframe width="560" height="315" src="https://www.youtube.com/embed/gbiqF-eyTW4" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    <h4 {...{
      "id": "redisai-from-the-command-line"
    }}>{`RedisAI from the Command Line`}</h4>
    <div class="text--center">
      <iframe width="560" height="315" src="https://www.youtube.com/embed/-w6rxLyoJdA" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
